class Planit extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
    	<div className="container-fluid">
	      <h1>Planit</h1>
	      <Map
	        google={this.props.google}
	        zoom={8}
	        style={mapStyles}
	        initialCenter={{ lat: 47.444, lng: -122.176}}
	      />
	    </div>
    );
  }
}

export default Planit;
